description:
TPB, I am back!

This is Jeopardy! in HD optimized for mobile devices. If you play this on a big screen, it will not look fantastic, but it is Jeopardy! The original HD files are too big for me to seed on my bandwidth. 

I've noticed there is someone else who uploads Jeopardy for the week at the end of the week. I'm not trying to pull the rug out from under them -- I'm just trying to help!

As Jeopardy! is not in syndication anywhere online, I have included the original commercials intact. I encourage you to watch them and support Jeopardy! sponsors.
